import './App.css';
import Navbar from './components/Navbar.js';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function App() {
  return (
    <div>
     <Router>

        <Navbar>

        </Navbar>
        <h2 className='title'>Product Management Software</h2>
        <Switch>
          <Route path='/'/>
        </Switch>
     </Router>

    </div>

  );
}

export default App;
